// PlaylistDetails.js

// ... (your imports and other code)

const PlaylistDetails = ({ setSelectedSong }) => {
  // ... (your existing code)

  return (
    <div className="playlist-details">
      <h2>Playlist Details</h2>
      {playlist ? (
        <div>
          <h3>{playlist.name}</h3>
          <p>Created on: {new Date(playlist.createdAt).toLocaleDateString()}</p>
          <p>Last Updated: {new Date(playlist.updatedAt).toLocaleDateString()}</p>
          <h4>Tracks:</h4>
          <table>
            <thead>
              <tr>
                <th>Track Details</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {playlist.tracks.map((track) => (
                <tr key={track._id}>
                  <td>
                    <div>
                      <strong>Title:</strong> {track.name} <br />
                      <strong>Image URL:</strong> {track.imageURL} <br />
                      <strong>Artist:</strong> {track.artist}
                    </div>
                  </td>
                  <td>
                    <button onClick={() => handlePlaySong(track)}>Play</button>
                    <button onClick={() => handleRemoveSong(track._id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default PlaylistDetails;
